    /**
     * Get Fibonacci value
     * 
     * @param string $n
     * @return string|null
     */
    public function get($n)
    {
        if ($n <= 0) {
            return 0;
        }
        
        if (1 == $n) {
            return 1;
        }
        
        if (isset($this->_table[$n])) {
            return $this->_table[$n];
        }
        
        return null;
    }
    
    /**
     * Get marker
     * 
     * @param integer $n
     * @return integer
     */
    public function getMarker($n)
    {
        $lastMarker = 1;
        
        // iterate all markers
        foreach ($this->_table as $marker => $value) {
            // first marker found larger than requested value
            if ($marker > $n) {
                break;
            }
            
            $lastMarker = $marker;
        }
        
        return $lastMarker;
    }
